import React, { useEffect, useState } from "react";

const Services = () => {
  const [services, setServices] = useState([])
  useEffect(() => {
    fetch('../../../../public')
      .then((res) => res.json())
      .then((data) => setServices(data));
  }, []);
  return (
    <div>
      <h1>this is Services</h1>
     <h4> {services.length} </h4> 
    </div>
  );
};

export default Services;
